// Nuova versione della dashboard con utenti e auto, visualizzazione laterale e layout sistemato
import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from '../api/axiosInstance';
import '../App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEye, faPen, faTrash, faPlus } from '@fortawesome/free-solid-svg-icons';

interface User {
    userId: number;
    nome: string;
    cognome: string;
}

interface MezzoBean {
    mezzoId: number;
    modello: string;
    targa: string;
    marca: string;
    colore: string;
}

interface Auto {
    autoId: number;
    mezzoBean?: MezzoBean;
}

const Dashboard: React.FC = () => {
    const [users, setUsers] = useState<User[]>([]);
    const [auto, setAuto] = useState<Auto[]>([]);
    const [showUsers, setShowUsers] = useState(false);
    const [showAuto, setShowAuto] = useState(false);
    const navigate = useNavigate();

    const getNomeUtenteFromToken = (): string => {
        const token = localStorage.getItem('token');
        if (!token) return '';
        try {
            const payload = token.split('.')[1];
            const decoded = JSON.parse(atob(payload));
            return `${decoded.nome || ''} ${decoded.cognome || ''}`.trim();
        } catch (e) {
            console.error('Errore nel parsing del token:', e);
            return '';
        }
    };

    const nomeUtente = getNomeUtenteFromToken();

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (!token) {
            navigate('/login');
            return;
        }

        axios.get('/user/findAllUsers')
            .then(res => {
                const list = res.data.userBeanList;
                if (Array.isArray(list)) setUsers(list);
            })
            .catch(err => console.error('Errore nel caricamento utenti:', err));

        axios.get('/automezzi/findAllAuto')
            .then(res => {
                const list = res.data.autoBeanList;
                if (Array.isArray(list)) setAuto(list);
            })
            .catch(err => console.error('Errore nel caricamento auto:', err));
    }, [navigate]);

    const handleLogout = () => {
        localStorage.removeItem('token');
        navigate('/login');
    };

    const handleAddUser = () => {
        navigate('/user/new');
    };

    const handleAddAuto = () => {
        navigate('/auto/new');
    };

    const handleDeleteUser = async (userId: number) => {
        if (!window.confirm(`Sei sicuro di voler eliminare l'utente?`)) return;
        try {
            const res = await axios.delete(`/user/deleteUser/${userId}`);
            if (res.data.errorCode === 0) {
                setUsers(prev => prev.filter(u => u.userId !== userId));
                alert('✅ Utente eliminato con successo');
            } else {
                alert(`⚠️ Errore: ${res.data.errorMessage}`);
            }
        } catch (err) {
            console.error('Errore durante eliminazione utente:', err);
            alert('❌ Errore durante la richiesta al server.');
        }
    };

    const handleDeleteAuto = async (autoId: number) => {
        if (!window.confirm(`Sei sicuro di voler eliminare l'automezzo?`)) return;
        try {
            const res = await axios.delete(`/automezzi/deleteAuto/${autoId}`);
            if (res.data.errorCode === 0) {
                setAuto(prev => prev.filter(a => a.autoId !== autoId));
                alert('✅ Automezzo eliminato con successo');
            } else {
                alert(`⚠️ Errore: ${res.data.errorMessage}`);
            }
        } catch (err) {
            console.error('Errore durante eliminazione auto:', err);
            alert('❌ Errore durante la richiesta al server.');
        }
    };

    return (
        <div className="dashboard-layout">
            <header className="dashboard-header">
                <div className="dashboard-username">Benvenuto, <span>{nomeUtente}</span></div>
                <button className="logout" onClick={handleLogout}>Logout</button>
            </header>

            <aside className="sidebar">
                <h3 onClick={() => setShowUsers(!showUsers)}>{showUsers ? '▼' : '▶'} Utenti</h3>
                <h3 onClick={() => setShowAuto(!showAuto)}>{showAuto ? '▼' : '▶'} Automezzi</h3>
            </aside>

            <main className="main-content">
                {showUsers && (
                    <div className="user-section">
                        <div className="user-header">
                            <h3>Lista Utenti</h3>
                            <button className="btn-add" onClick={handleAddUser}>
                                <FontAwesomeIcon icon={faPlus} /> Aggiungi Utente
                            </button>
                        </div>
                        <table className="user-table">
                            <thead>
                                <tr>
                                    <th>Nome</th>
                                    <th>Azioni</th>
                                </tr>
                            </thead>
                            <tbody>
                                {users.map(user => (
                                    <tr key={user.userId}>
                                        <td>{user.nome} {user.cognome}</td>
                                        <td>
                                            <Link to={`/user/${user.userId}`}><button className="view-btn"><FontAwesomeIcon icon={faEye} /></button></Link>
                                            <Link to={`/user/edit/${user.userId}`}><button className="edit-btn"><FontAwesomeIcon icon={faPen} /></button></Link>
                                            <button className="delete-btn" onClick={() => handleDeleteUser(user.userId)}><FontAwesomeIcon icon={faTrash} /></button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                )}

                {showAuto && (
                    <div className="auto-section">
                        <div className="user-header">
                            <h3>Lista Automezzi</h3>
                            <button className="btn-add" onClick={handleAddAuto}>
                                <FontAwesomeIcon icon={faPlus} /> Aggiungi Automezzo
                            </button>
                        </div>
                        <table className="user-table">
                            <thead>
                                <tr>
                                    <th>Modello</th>
                                    <th>Targa</th>
                                    <th>Azioni</th>
                                </tr>
                            </thead>
                            <tbody>
                                {auto.map(a => (
                                    <tr key={a.autoId}>
                                        <td>{a.mezzoBean?.modello}</td>
                                        <td>{a.mezzoBean?.targa}</td>
                                        <td>
                                            <Link to={`/auto/${a.autoId}`}><button className="view-btn"><FontAwesomeIcon icon={faEye} /></button></Link>
                                            <button className="edit-btn"><FontAwesomeIcon icon={faPen} /></button>
                                            <button className="delete-btn" onClick={() => handleDeleteAuto(a.autoId)}><FontAwesomeIcon icon={faTrash} /></button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                )}
            </main>
        </div>
    );
};

export default Dashboard;
